namespace RonSijm.FluidHumidifier.Factories.Cognito;

public class UserPoolFactory(string resourceName = null, Action<Humidifier.Cognito.UserPool> factoryAction = null) : ResourceFactory<Humidifier.Cognito.UserPool>(resourceName)
{

    internal List<InnerUserPoolSchemaAttributeFactory> SchemaFactories { get; set; } = [];

    internal InnerUserPoolPoliciesFactory PoliciesFactory { get; set; }

    internal InnerUserPoolVerificationMessageTemplateFactory VerificationMessageTemplateFactory { get; set; }

    internal InnerUserPoolAdminCreateUserConfigFactory AdminCreateUserConfigFactory { get; set; }

    internal InnerUserPoolUsernameConfigurationFactory UsernameConfigurationFactory { get; set; }

    internal InnerUserPoolUserPoolAddOnsFactory UserPoolAddOnsFactory { get; set; }

    internal InnerUserPoolUserAttributeUpdateSettingsFactory UserAttributeUpdateSettingsFactory { get; set; }

    internal InnerUserPoolEmailConfigurationFactory EmailConfigurationFactory { get; set; }

    internal InnerUserPoolSmsConfigurationFactory SmsConfigurationFactory { get; set; }

    internal InnerUserPoolLambdaConfigFactory LambdaConfigFactory { get; set; }

    internal InnerUserPoolDeviceConfigurationFactory DeviceConfigurationFactory { get; set; }

    internal InnerUserPoolAccountRecoverySettingFactory AccountRecoverySettingFactory { get; set; }

    protected override Humidifier.Cognito.UserPool Create()
    {
        var userPoolResult = CreateUserPool();
        factoryAction?.Invoke(userPoolResult);

        return userPoolResult;
    }

    private Humidifier.Cognito.UserPool CreateUserPool()
    {
        var userPoolResult = new Humidifier.Cognito.UserPool
        {
            GivenName = InputResourceName,
        };

        return userPoolResult;
    }
    public override void CreateChildren(Humidifier.Cognito.UserPool result)
    {
        base.CreateChildren(result);

        result.Schema = SchemaFactories.Any() ? SchemaFactories.Select(x => x.Build()).ToList() : null;
        result.Policies ??= PoliciesFactory?.Build();
        result.VerificationMessageTemplate ??= VerificationMessageTemplateFactory?.Build();
        result.AdminCreateUserConfig ??= AdminCreateUserConfigFactory?.Build();
        result.UsernameConfiguration ??= UsernameConfigurationFactory?.Build();
        result.UserPoolAddOns ??= UserPoolAddOnsFactory?.Build();
        result.UserAttributeUpdateSettings ??= UserAttributeUpdateSettingsFactory?.Build();
        result.EmailConfiguration ??= EmailConfigurationFactory?.Build();
        result.SmsConfiguration ??= SmsConfigurationFactory?.Build();
        result.LambdaConfig ??= LambdaConfigFactory?.Build();
        result.DeviceConfiguration ??= DeviceConfigurationFactory?.Build();
        result.AccountRecoverySetting ??= AccountRecoverySettingFactory?.Build();
    }

} // End Of Class

